window.bookSummaryJSON = "<p><b>The Brotherhood wants her gone. The demons want her dead. Not bad for her first day as a Chosen One.</b>&nbsp;</p> <p>When Nava Katz half-drunkenly interrupts her twin brother's induction ceremony into a secret supernatural society, she doesn’t expect to accidentally torch his life-long dream and steal his destiny.&nbsp;</p> <p>Horrified she’s now expected to take his place, Nava is faced with the one thing she swore off forever: a purpose.&nbsp;</p> <p>The all-male squad isn’t cool with a woman in their ranks and assigns her to Rohan Mitra: former rock god and their most ruthless hunter. He may be the perfect bad boy fling with no strings attached, but what happens when he won’t let her run - not even from herself?&nbsp;</p> <p>That might prove as dangerous as defeating the vengeful demon out for her brother’s blood.&nbsp;</p> <p>Odds of her new teammates expecting her to fail? Best not to think about that.&nbsp;</p> <p>Odds her succeeding out of spite?&nbsp;</p> <p>Dive into this complete series and find out. “Don’t buy it if your offended by bad language, immoral behavior, lose ethics, sassy attitude, hot guys ... cuz it does it all - and its GREAT!!!” – Amazon Reviewer&nbsp;&nbsp;</p>"; 
